import React, { Component } from "react";
import "./App.css";

class Question extends Component {
  render() {
    return (
        <ul class="list-group">
            <li class="list-group-item">Q{this.props.date_index}: {this.props.question}</li>
        </ul>
    );
  }
}

export default Question;
